utilizadas = 0

def conexiones(socket_cliente):
    peticion = socket_cliente.recv(1024)
    print ("[*] Mensaje recibido: %s" % peticion)
    global lecturas
    global utilizadas
    if utilizadas >= len(lecturas):
        utilizadas = 0
    mensaje = lecturas[utilizadas]
    utilizadas = utilizadas+1
    b = bytearray()
    b.extend(map(ord, mensaje))
    print(len(mensaje))
  
    while True:
        socket_cliente.send(b)
    socket_cliente.close()

def main():
    ip = "127.0.0.1" 
    puerto = 10500 
    max_conexiones = 5 
    servidor = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
    servidor.setsockopt(socket.SOL_SOCKET, socket.SO_REUSEADDR, 1) 
    h_conexion=list()
    
    
    servidor.bind((ip, puerto))
    servidor.listen(max_conexiones)
    
    
    print ("[*] Esperando conexiones en %s:%d" % (ip, puerto))
    
    
    while True:
        servidor.listen(max_conexiones)
        cliente, direccion = servidor.accept()
        print ("[*] Conexion establecida con %s:%d" % (direccion[0] , direccion[1]))
        conex = threading.Thread(target=conexiones, args=(cliente,))
        conex.start()
        h_conexion.append(conex)
    
    for hilo in h_conexion:
        hilo.join()
main()